import './TableStd.css'
import { useState,useEffect } from "react";
import { Link } from 'react-router-dom';
import axios from 'axios';
function TableStd(){
    const [list,setList]=useState([]);
    useEffect(()=>{
        axios.get('http://localhost:8800/getdata').then((geted)=>{setList(geted.data)})
    },[])
    return(
    <div>
        <Link to='./FormStd'>add</Link><br></br>
        <div  className='search'>  <input type='text' placeholder='Search'></input><button>ss</button></div>
 
              
    <table> 
          <thead>
            <th>ID </th>
            <th>FIRSTB NAME</th>
            <th>LAST NAME</th>
            <th>LACATION</th>
            <th>GMAIL</th>
            <th>D.O.B</th>
            <th>EDUCATION</th>
            <th>EDIT</th>
            <th>DELETE</th>
            </thead>
        <tbody>
        {list.map((e,i)=>{
            return(
                <tr>
                    <td>{e.id}</td>
                    <td>{e.firstName}</td>
                    <td>{e.lastName}</td>
                    <td>{e.location}</td>
                    <td>{e.gmail}</td>
                    <td>{e.brithDay}</td>
                    <td>{e.education}</td>
                    <td><button className='but'>Edit</button></td>
                    <td><button className='but'>Delete</button></td>
                </tr>
            )

        })}
        
        </tbody>
    </table>


    </div>)

}export default TableStd;
